html_content = """
<p class="Paragraf" id="id58ce6fa8-5ce0-4072-824f-854ac8c1a1b5">  <span id="P1">  </span>  <span class="ParagrafNr" id="Par1">§ 1.</span> Formålet med denne lov er  </p>  <p class="Paragraf" id="idf24ba5f1-e79f-4868-8351-f9f1f45f89f0">  <span id="P2">  </span>  <span class="ParagrafNr" id="Par2">§ 2.</span> Ret til fravær efter denne lov  omfatter alle forældre.  <p class="Paragraf" id="id01b7e86a-a09a-4798-a6ba-8b192aca0fb6">  <span id="P3">  </span>  <span class="ParagrafNr" id="Par3">§ 3.</span> Retten til barselsdagpenge er  betinget af, at personen ved fraværsperiodens begyndelse har lovligt ophold her i  <p class="Paragraf" id="idde5ce01e-d39b-47f8-8b60-d2ae72022fa1">  <span id="P4">  </span>  <span class="ParagrafNr" id="Par4">§ 4.</span> Retten til barselsdagpenge er  betinget af, at den indkomst, der indgår i beregningsgrundlaget efter kapitel 8, kan  <p class="Paragraf" id="idd1c96dd1-8549-4c19-8a79-5c72b8780225">  <span id="P5">  </span>  <span class="ParagrafNr" id="Par5">§ 5.</span> Personer med ophold her i landet  eller indkomst omfattet af § 4, stk. 1, kan ikke opnå barselsdagpenge, hvis de efter  <p class="Paragraf" id="idc59e1dad-55a1-4993-9c98-e30af8659a53">  <span id="P6">  </span>  <span class="ParagrafNr" id="Par6">§ 6.</span> En kvinde har ret til fravær fra  arbejdet på grund af graviditet, når der skønnes at være 4 uger til fødslen.  <p class="Paragraf" id="id6bd230d2-0825-4b3c-85f7-8059e122dfd2">  <span id="P7">  </span>  <span class="ParagrafNr" id="Par7">§ 7.</span> En mor har ret og pligt til fravær i  de første 2 uger efter en fødsel. Herefter har hun ret til fravær i yderligere 8  <p class="Paragraf" id="ide0ac66e0-2563-4ae9-83f1-b07c47039034">  <span id="P7a">  </span>  <span class="ParagrafNr" id="Par7a">§ 7 a.</span> En beskæftiget mor, som genoptager  arbejdet på fuld tid, kan overdrage op til 8 uger af sin ret til fravær efter § 7,  <p class="Paragraf" id="id6d2502a8-4994-4568-b19a-e0d3a7aeaecd">  <span id="P8">  </span>  <span class="ParagrafNr" id="Par8">§ 8.</span> Kommende adoptanter, der opholder sig  i udlandet for at modtage et barn, har hver ret til fravær fra arbejdet i op til 4  <p class="Paragraf" id="ide628626f-2b77-4586-8508-2202ac62b7c4">  <span id="P9">  </span>  <span class="ParagrafNr" id="Par9">§ 9.</span> Efter den 10. uge efter fødslen eller  modtagelsen af barnet har hver af forældrene ret til fravær i 32 uger. Faren eller  <p class="Paragraf" id="id8dbfbb58-e701-4dbd-9092-67415f6baf61">  <span id="P10">  </span>  <span class="ParagrafNr" id="Par10">§ 10.</span> Hver af forældrene har ret til at  forlænge fraværet efter § 9 fra 32 uger til 40 uger. Beskæftigede lønmodtagere og  <p class="Paragraf" id="id43c4a948-6fe7-4e18-aa7a-dcbc2d577c03">  <span id="P11">  </span>  <span class="ParagrafNr" id="Par11">§ 11.</span> Beskæftigede lønmodtagere har ret  til at genoptage arbejdet og udskyde op til 5 uger af fraværsretten efter § 9. Det  <p class="Paragraf" id="ide0e9cfd5-9100-427a-8983-ad9b756385ee">  <span id="P12">  </span>  <span class="ParagrafNr" id="Par12">§ 12.</span> Efter aftale med arbejdsgiveren kan  en beskæftiget lønmodtager genoptage arbejdet helt eller delvis under fravær efter  <p class="Paragraf" id="id6d566a50-3fcf-4756-ad3e-93e8628ee33b">  <span id="P13">  </span>  <span class="ParagrafNr" id="Par13">§ 13.</span> Hver af forældrene har ret til  fravær i 26 uger efter barnets død, hvis barnet er dødfødt eller dør inden det  <p class="Paragraf" id="id838765bd-47bb-4e6b-8c7b-57733d654ab6">  <span id="P14">  </span>  <span class="ParagrafNr" id="Par14">§ 14.</span> Hvis barnet er indlagt på sygehus,  forlænges eller udsættes den periode, hvor der er ret til fravær.  <p class="Paragraf" id="id92b7aa79-904d-4f53-ae61-6945cde06036">  <span id="P14a">  </span>  <span class="ParagrafNr" id="Par14a">§ 14 a.</span> Forældre, der får tre eller  flere børn ved samme fødsel, har ret til ekstra fravær i 26 uger tilsammen.  <p class="Paragraf" id="id444b9af0-1073-453f-a3f5-2d3718f33902">  <span id="P15">  </span>  <span class="ParagrafNr" id="Par15">§ 15.</span> En kvindelig lønmodtager skal med 3  måneders varsel underrette arbejdsgiveren om forventet fødselstidspunkt, og om hun  <p class="Paragraf" id="idc557718d-4bb4-4841-a52d-675b8012fef0">  <span id="P15a">  </span>  <span class="ParagrafNr" id="Par15a">§ 15 a.</span> En lønmodtager i et  ansættelsesforhold, der ikke har haft mulighed for inden 6 uger efter barnets fødsel  <p class="Paragraf" id="idae9a9eac-3bd0-4132-a01d-3a6ca8cc6a4c">  <span id="P16">  </span>  <span class="ParagrafNr" id="Par16">§ 16.</span> En lønmodtager, der ønsker at  udskyde op til 5 uger af fraværet, jf. § 11, skal underrette arbejdsgiveren herom  <p class="Paragraf" id="id770b00da-c78f-48ea-a906-9b5dff6fefe0">  <span id="P17">  </span>  <span class="ParagrafNr" id="Par17">§ 17.</span> Lønmodtageren har ret til at ændre  anvendelsen af fraværsretten, hvis nyt varsel afgives inden udløbet af fristen for  <p class="Paragraf" id="id09ce6167-1efc-4650-b4eb-3b26f2f9c888">  <span id="P18">  </span>  <span class="ParagrafNr" id="Par18">§ 18.</span> Arbejdsgiveren udbetaler dagpenge  under fravær fra arbejdet på grund af forebyggende graviditetsundersøgelser, jf. §  <p class="Paragraf" id="idac2af3a3-b480-466d-bb72-b81f12a0c4be">  <span id="P19">  </span>  <span class="ParagrafNr" id="Par19">§ 19.</span> Til personer, der opfylder  betingelserne for ret til barselsdagpenge, herunder beskæftigelseskravet for  <p class="Paragraf" id="idb56f8b60-2d4a-4a5c-a377-ca053dcd1788">  <span id="P20">  </span>  <span class="ParagrafNr" id="Par20">§ 20.</span> Ved fravær efter § 6, stk. 1 og 2,  og §§ 7, 7 a, 8, 13, 14 og 14 a udbetaler Udbetaling Danmark barselsdagpenge  <p class="Paragraf" id="id615a29ef-3f1b-4118-abac-bde90a66c73f">  <span id="P21">  </span>  <span class="ParagrafNr" id="Par21">§ 21.</span> Ved fravær efter §§ 9 og 10 har en  mor ret til barselsdagpenge i 14 uger, og en far eller medmor har ret til  <p class="Paragraf" id="iddb3f030f-7ea3-4861-962c-89e29a4d4c0e">  <span id="P21a">  </span>  <span class="ParagrafNr" id="Par21a">§ 21 a.</span> En forælder, der kommer i  beskæftigelse som lønmodtager inden 1 år efter barnets fødsel eller modtagelse, og  <p class="Paragraf" id="id1c30f915-718a-4b31-99a3-d5ca53a2722f">  <span id="P21b">  </span>  <span class="ParagrafNr" id="Par21b">§ 21 b.</span> Hvis forældrene ikke bor sammen  på tidspunktet for barnets fødsel eller modtagelse, har den forælder, der har barnet  <p class="Paragraf" id="id1f449f21-cfc9-4b71-82ec-130c41b57a1e">  <span id="P21c">  </span>  <span class="ParagrafNr" id="Par21c">§ 21 c.</span> Hvis barnet kun har én forælder  på tidspunktet for barnets fødsel eller modtagelse, har forælderen ud over ret til  <p class="Paragraf" id="id0bbd3f3a-a655-4530-84f8-f81ae5a860d7">  <span id="P22">  </span>  <span class="ParagrafNr" id="Par22">§ 22.</span> Lønmodtagere og selvstændige  erhvervsdrivende kan genoptage arbejdet helt eller delvis i de perioder, hvor der er  <p class="Paragraf" id="id7b44f9eb-3d4e-489f-a8b0-dee97c100bcc">  <span id="P23">  </span>  <span class="ParagrafNr" id="Par23">§ 23.</span> Ved delvis genoptagelse af arbejdet  under fravær efter § 7, § 7 a, stk. 2, § 8, stk. 6, og § 9 kan retten til  <p class="Paragraf" id="id68118eb4-3a15-415b-9591-b340049a53fa">  <span id="P24">  </span>  <span class="ParagrafNr" id="Par24">§ 24.</span> Beskæftigelsesministeren kan  fastsætte nærmere regler om ret til dagpenge efter §§ 18-23.  <p class="Paragraf" id="id1af0d387-f9e9-45f5-9446-28f7abcdefcd">  <span id="P25">  </span>  <span class="ParagrafNr" id="Par25">§ 25.</span> Når der udbetales barselsdagpenge  under fravær efter § 7, stk. 1 eller 2, eller § 8, stk. 6, 1. pkt., til og med den  <p class="Paragraf" id="id7f3285ac-8cf2-42a2-a5a3-d15922c67f1e">  <span id="P25a">  </span>  <span class="ParagrafNr" id="Par25a">§ 25 a.</span> En lønmodtager, som er i et  ansættelsesforhold under fravær efter § 7, stk. 1 eller 2, eller § 8, stk. 6, 1.  <p class="Paragraf" id="idb51972c0-14f8-451f-90b0-5881bf8d75d2">  <span id="P25b">  </span>  <span class="ParagrafNr" id="Par25b">§ 25 b.</span> En lønmodtager, som er i et  ansættelsesforhold under fravær efter § 6, stk. 1, eller § 7, stk. 1 eller 2, fravær  <p class="Paragraf" id="id7065b2fc-205c-4758-ac48-6fc8bea98857">  <span id="P25c">  </span>  <span class="ParagrafNr" id="Par25c">§ 25 c.</span> En person, som ikke er i et  ansættelsesforhold under fravær efter § 7, stk. 1 eller 2, eller § 8, stk. 6, 1.  <p class="Paragraf" id="id4c3f7de1-f477-4305-b7cc-0af9ab0d9cd8">  <span id="P25d">  </span>  <span class="ParagrafNr" id="Par25d">§ 25 d.</span> En person, som ikke er i et  ansættelsesforhold under fravær efter § 6, stk. 1, eller § 7, stk. 1 eller 2, fravær  <p class="Paragraf" id="idf106949f-ec40-473c-a765-e42635cc1a6c">  <span id="P26">  </span>  <span class="ParagrafNr" id="Par26">§ 26.</span> Forældre med alvorligt syge børn  under 18 år har ret til dagpenge fra Udbetaling Danmark, hvis de i forbindelse med  <p class="Paragraf" id="id4a331bde-2314-4aec-a18f-e6514b682ca6">  <span id="P26a">  </span>  <span class="ParagrafNr" id="Par26a">§ 26 a.</span> En lønmodtager i et  ansættelsesforhold eller en selvstændig erhvervsdrivende, som er forælder til et  <p class="Paragraf" id="idebc1f5d7-6b8c-44cb-907a-f65b6a8f36f9">  <span id="P26b">  </span>  <span class="ParagrafNr" id="Par26b">§ 26 b.</span> En lønmodtager i et  ansættelsesforhold eller en selvstændig erhvervsdrivende, som er forælder til et  <p class="Paragraf" id="id8fc273af-966b-412c-b18a-02b4d1d51e2f">  <span id="P26c">  </span>  <span class="ParagrafNr" id="Par26c">§ 26 c.</span> Udbetaling Danmark kan for  perioden til og med den 31. december 2020 udbetale dagpenge efter §§ 26 a og 26 b  <p class="Paragraf" id="id7658cce6-c6b5-46f2-9824-eca536dc91f7">  <span id="P27">  </span>  <span class="ParagrafNr" id="Par27">§ 27.</span> En lønmodtager har ret til  barselsdagpenge fra Udbetaling Danmark, når den pågældende  <p class="Paragraf" id="ide3fcae75-34ae-4a72-b49a-8a7c71362d27">  <span id="P28">  </span>  <span class="ParagrafNr" id="Par28">§ 28.</span> Retten til barselsdagpenge for en  selvstændig erhvervsdrivende er betinget af, at der inden for de sidste 12 måneder  <p class="Paragraf" id="id449ed120-c3a8-460d-a579-b4ab80e8870b">  <span id="P29">  </span>  <span class="ParagrafNr" id="Par29">§ 29.</span> Betingelsen for udbetaling af  barselsdagpenge er, at beskæftigelseskravet i § 27 eller beskæftigelseskravet i § 28  <p class="Paragraf" id="id3e1bc903-caf4-4fa4-92bf-eff705a05e64">  <span id="P30">  </span>  <span class="ParagrafNr" id="Par30">§ 30.</span> Ved anmodning om barselsdagpenge  efter § 20 i forbindelse med fravær før 4 uger før forventet fødsel, jf. § 6, stk.  <p class="Paragraf" id="idd64b553a-bc01-42ef-8618-51ec688b3b52">  <span id="P31">  </span>  <span class="ParagrafNr" id="Par31">§ 31.</span> Anmodning om dagpenge ved pasning  af alvorligt syge børn efter § 26 skal indgives til Udbetaling Danmark senest 8 uger  <p class="Paragraf" id="idd771a7bf-2d1e-4ae1-9b0e-c31984ec5dbf">  <span id="P32">  </span>  <span class="ParagrafNr" id="Par32">§ 32.</span> Barselsdagpenge ydes på grundlag af  lønindtægt og anden indtægt, der erstatter lønindtægt, jf. stk. 2, og selvstændig  <p class="Paragraf" id="idf8d0f746-7beb-4768-8fb2-d453a32739a5">  <span id="P33">  </span>  <span class="ParagrafNr" id="Par33">§ 33.</span> Barselsdagpenge til lønmodtagere,  der er fraværende, beregnes på grundlag af det ugentlige timetal under fraværet og  <p class="Paragraf" id="idc26b2379-a027-4916-b6b0-c59c353fb35a">  <span id="P34">  </span>  <span class="ParagrafNr" id="Par34">§ 34.</span> Beskæftigelsesministeren fastsætter  regler om beregning af dagpenge efter denne lov til personer ansat i fleksjob og  <p class="Paragraf" id="id00f2f9ac-25f7-425a-8e68-86e0c87231ee">  <span id="P35">  </span>  <span class="ParagrafNr" id="Par35">§ 35.</span> Barselsdagpenge til lønmodtagere  efter § 33 kan ikke udgøre mere end 3.332 kr. om ugen og ikke mere pr. time end  <p class="Paragraf" id="ida15436e5-7d7e-4dfa-baa7-3765c00eb599">  <span id="P36">  </span>  <span class="ParagrafNr" id="Par36">§ 36.</span> Barselsdagpenge til et ledigt  medlem af en anerkendt arbejdsløshedskasse udbetales med den sats, som personen på  <p class="Paragraf" id="id6024ca6f-ed31-47ce-b97f-2e1b149000f9">  <span id="P37">  </span>  <span class="ParagrafNr" id="Par37">§ 37.</span> Barselsdagpenge til selvstændige  erhvervsdrivende kan pr. uge ikke udgøre mere end det beløb, der er nævnt i § 35,  <p class="Paragraf" id="id73331626-40f2-4152-8914-45415d1b4364">  <span id="P38">  </span>  <span class="ParagrafNr" id="Par38">§ 38.</span> Det dagpengebeløb, der er nævnt i §  35, stk. 1, reguleres én gang om året pr. den første mandag i januar med 1,7 pct.  <p class="Paragraf" id="ide44ef01f-1772-4209-96d6-c932d8ea4032">  <span id="P38a">  </span>  <span class="ParagrafNr" id="Par38a">§ 38 a.</span> (Ophævet)  </p>  <p class="Paragraf" id="id39602463-5a0d-455d-baab-9c668a1f5226">  <span id="P39">  </span>  <span class="ParagrafNr" id="Par39">§ 39.</span> En arbejdsgiver, der udbetaler løn  under fravær fra arbejdet, er berettiget til at få udbetalt de barselsdagpenge, som  <p class="Paragraf" id="id72f735e7-6465-460c-b011-bd57a223893c">  <span id="P39a">  </span>  <span class="ParagrafNr" id="Par39a">§ 39 a.</span> En arbejdsgiver, som modtager  refusion efter denne lov, er berettiget til at modtage et tillæg til refusion.  <p class="Paragraf" id="id0bfa3cd0-4730-4d96-be24-1e760f2e3842">  <span id="P39b">  </span>  <span class="ParagrafNr" id="Par39b">§ 39 b.</span> Tillægget til refusion til  arbejdsgiveren beregnes med følgende procentsatser:  <p class="Paragraf" id="id14739b3c-5306-4e8c-906b-1f82476763e6">  <span id="P39c">  </span>  <span class="ParagrafNr" id="Par39c">§ 39 c.</span> Beskæftigelsesministeren  fastsætter regler om en arbejdsgivers tillæg til refusion, herunder regler om  <p class="Paragraf" id="id05db0f61-aea1-48ac-a21b-d03e8912bc0d">  <span id="P40">  </span>  <span class="ParagrafNr" id="Par40">§ 40.</span> En arbejdsgiver, der efter § 39 er  berettiget til refusion af barselsdagpenge, skal anmelde refusionskravet via  <p class="Paragraf" id="id764c9eb2-2224-4054-8a2b-374c40bc960b">  <span id="P41">  </span>  <span class="ParagrafNr" id="Par41">§ 41.</span> Der ydes ikke refusion af udgifter  til dagpenge efter § 18.  <p class="Paragraf" id="id0d159589-36f6-4ee0-837d-25bae6c076f8">  <span id="P42">  </span>  <span class="ParagrafNr" id="Par42">§ 42.</span> Staten afholder udgifterne til  Udbetaling Danmarks udbetalinger efter denne lov.  <p class="Paragraf" id="id28e488b6-e774-4969-b09b-81737c943d0b">  <span id="P43">  </span>  <span class="ParagrafNr" id="Par43">§ 43.</span> (Ophævet)  </p>  <p class="Paragraf" id="id1435ca23-2549-4ac3-a485-e12b13c18974">  <span id="P44">  </span>  <span class="ParagrafNr" id="Par44">§ 44.</span> Ved udbetaling af dagpenge fra  Udbetaling Danmark efter denne lov til lønmodtagere, der er fyldt 16 år, indbetales  <p class="Paragraf" id="idc282d3b6-3a94-418f-8725-5517ffdf9d74">  <span id="P45">  </span>  <span class="ParagrafNr" id="Par45">§ 45.</span> Udbetaling Danmarks indbetaling til  Arbejdsmarkedets Tillægspension dækkes af et bidrag fra arbejdsgiveren. Udbetaling  <p class="Paragraf" id="id3bd3743f-fe01-4820-b86b-d2ecc9c78d88">  <span id="P46">  </span>  <span class="ParagrafNr" id="Par46">§ 46.</span> Ved udbetaling af dagpenge efter §  18 fra arbejdsgivere under fravær på grund af forebyggende graviditetsundersøgelser  <p class="Paragraf" id="id0c6a8105-cb10-474c-8ae7-da786283fd47">  <span id="P47">  </span>  <span class="ParagrafNr" id="Par47">§ 47.</span> For personer, som modtager dagpenge  efter denne lov fra Udbetaling Danmark, indbetaler Udbetaling Danmark et bidrag til  <p class="Paragraf" id="idc82d5c07-3956-41af-a17c-0cf12df4d56c">  <span id="P47a">  </span>  <span class="ParagrafNr" id="Par47a">§ 47 a.</span> Bidraget til den obligatoriske  pensionsordning beregnes med følgende procentsatser:  <p class="Paragraf" id="id70d44bbb-4d76-459a-a4f3-9a7d7b7da079">  <span id="P47b">  </span>  <span class="ParagrafNr" id="Par47b">§ 47 b.</span> Beskæftigelsesministeren  fastsætter regler om beregning af bidrag til den obligatoriske pensionsordning,  <p class="Paragraf" id="id4abb5b81-12b2-4b06-81b1-8b721e9707a7">  <span id="P48">  </span>  <span class="ParagrafNr" id="Par48">§ 48.</span> Udbetaling Danmark træffer  afgørelse om retten til barselsdagpenge.  <p class="Paragraf" id="id7dc0da10-93b2-48ce-b8ee-7fbc3dd41ca8">  <span id="P48a">  </span>  <span class="ParagrafNr" id="Par48a">§ 48 a.</span> Til brug for Udbetaling Danmarks  afgørelse om en persons ret til dagpenge efter barselsloven, herunder sats, kan  <p class="Paragraf" id="id6f15e86e-0c9e-4e30-907a-c3144fc67e57">  <span id="P49">  </span>  <span class="ParagrafNr" id="Par49">§ 49.</span> Personer, der modtager ydelser  efter denne lov, skal underrette arbejdsgiveren om forandringer i deres forhold  <p class="Paragraf" id="id00d1880c-d844-4cd9-b231-d2353c323dec">  <span id="P49a">  </span>  <span class="ParagrafNr" id="Par49a">§ 49 a.</span> En person har ikke ret til  barselsdagpenge for en periode, hvor personen ved endelig dom findes at have  <p class="Paragraf" id="idf79a3160-4045-4e23-8571-77fc1823e36f">  <span id="P49b">  </span>  <span class="ParagrafNr" id="Par49b">§ 49 b.</span> En person har ikke ret til  dagpenge efter denne lov i en periode på 3 år, hvis personen ved endelig dom findes  <p class="Paragraf" id="id20b559e8-0576-440d-83e6-33830bc6f7ca">  <span id="P49c">  </span>  <span class="ParagrafNr" id="Par49c">§ 49 c.</span> En person har ikke ret til  dagpenge efter denne lov i en periode på 3 år, hvis personen ved endelig dom er  <p class="Paragraf" id="idfb7d282d-010e-4a5d-aaff-9183e50accf9">  <span id="P50">  </span>  <span class="ParagrafNr" id="Par50">§ 50.</span> Krav på ydelser efter denne lov kan  ikke gøres til genstand for udlæg eller anden retsforfølgning, medmindre der er  <p class="Paragraf" id="id8fba9deb-2202-4860-9a24-3df51b71a914">  <span id="P51">  </span>  <span class="ParagrafNr" id="Par51">§ 51.</span> Udbetalingen af barselsdagpenge  ophører for en person, som efter domstolsafgørelse eller administrativ afgørelse er  <p class="Paragraf" id="id5a01cdb4-8b12-4fda-9d1e-186c3f4e2296">  <span id="P52">  </span>  <span class="ParagrafNr" id="Par52">§ 52.</span> Barselsdagpengeudbetalingen ophører  for en person, som bevidst unddrager sig strafforfølgning her i landet i tilfælde,  <p class="Paragraf" id="id6711efbc-9d01-4905-9dff-fdb6390094d0">  <span id="P53">  </span>  <span class="ParagrafNr" id="Par53">§ 53.</span> Efterfølges en strafforfølgning,  jf. § 52, stk. 1, ikke af en domfældelse, udbetaler Udbetaling Danmark  <p class="Paragraf" id="ida1abca30-366b-4c68-844d-87b2a1a15498">  <span id="P53a">  </span>  <span class="ParagrafNr" id="Par53a">§ 53 a.</span> Udbetaling af barselsdagpenge  ophører, hvis politiet træffer afgørelse om inddragelse af den pågældendes pas i  <p class="Paragraf" id="id2eb001ed-20f4-4739-a4fe-57ccf51b75c6">  <span id="P53b">  </span>  <span class="ParagrafNr" id="Par53b">§ 53 b.</span> Politiet skal underrette  Udbetaling Danmark, hvis politiet træffer afgørelse om inddragelse af pas i medfør  <p class="Paragraf" id="idaef42152-60f9-45cf-bc48-7395f4bd24ee">  <span id="P54">  </span>  <span class="ParagrafNr" id="Par54">§ 54.</span> Udbetaling Danmarks afgørelser om  ret til barselsdagpenge og om arbejdsgivers ret til tillæg til refusion kan påklages  <p class="Paragraf" id="idcd2cecfd-e308-4453-986b-bc12102fe81b">  <span id="P55">  </span>  <span class="ParagrafNr" id="Par55">§ 55.</span> Loven træder i kraft den 3. juli  2006.  <p class="Paragraf" id="id630ffcd8-3171-4c40-b94b-7dbb1488188d">  <span id="P56-59">  </span>  <span class="ParagrafNr" id="Par56-59">§§ 56-59.</span> (Udelades)  </p>  <p class="Paragraf" id="id5878cec4-9b60-468f-9572-b68e2f994826">  <span id="P60">  </span>  <span class="ParagrafNr" id="Par60">§ 60.</span> Loven gælder ikke for Færøerne og  Grønland.
"""


def main() -> None:
    # Parsing HTML using BeautifulSoup
    soup = BeautifulSoup(html_content, "html.parser")

    # Extracting required data
    data: List[ParagraphRef] = []

    for p in soup.find_all("p", class_="Paragraf"):
        span = p.find("span", class_="ParagrafNr")
        data.append(
            ParagraphRef(
                guid=p.get("id"),
                id=span.get("id"),
                ref=span.get_text().strip()[0:-1],
            )
        )

    json_data = ParagraphRefList(root=data).model_dump_json(indent=2)

    # Save the JSON data to a file
    file_path = "data/eli-lta-2023-1180-paragraph-refs.json"
    with open(file_path, "w") as f:
        f.write(json_data)

    print(f"JSON data saved to {file_path}")

    # Validate the JSON data
    obj = ParagraphRefList.from_json_path(file_path)
    print(obj)


if __name__ == "__main__":
    main()
